import React from 'react';
import ServiceCard from '../components/ServiceCard'; // Adjust path if needed
import { services } from '../data/servicesData'; // Adjust path if needed
import '../styles/Services.css'; // Your new CSS file

const Services = () => {
  return (
    <div className="page-container">
      <div className="page-content">
        <h1>Our Solutions for Thriving Teams</h1>
        <div className="services-grid">
          {services.map(service => (
            <ServiceCard key={service.id} service={service} />
          ))}
        </div>
      </div>
    </div>
  );
};

export default Services;
